import React from "react";
import logo from "../../assets/logo.png"
import { NavText } from "../../styling/css";


const Navbar = () => {

    return (
        <div className="container" style={{
            display: "flex",
            backgroundColor: "white",
            height: "5rem"
        }}>

            <div className="logo" style={{
                paddingTop: "0.8rem",
                paddingLeft: "6rem"
            }}>
                <img src={logo} />
            </div>
            <div className="NavText" style={{
                paddingTop: "1.2rem",
                paddingLeft: "0.2rem"
            }}>
                <NavText>
                    <div>Scorecard</div>
                </NavText>
            </div>
            <div className="Links">
                <ul style={{
                     display: "grid",
                     gridTemplateColumns: "60px, ",
                     gridGap: "10px",
                     listStyleType: "none",
                     textAlign: "center",
                     width: "70vw",
                     justifyContent: "end",
                     paddingRight: "2rem"
                    //  display: "flex"
                    //  paddingTop: "1rem",
                    //  paddingLeft: "45rem"
                    }}>

                    <li><a href="">Home</a></li>
                    <li><a href="">About</a></li>
                    <li><a href="">Learnings</a></li>
                    <li><a href="">Contact</a></li>
                    <li><button><a href="">Login</a></button></li>
                </ul>
            </div>

        </div>
    )
}

export default Navbar;
